import React from 'react';
import logo from './logo.svg';
import './App.css';
import {ProjectCard} from './typescript/ProjectCard';
import background from './Background.svg';
import {Menu} from './typescript/Menu';
import {HeroSection} from './typescript/HeroSection';
import { AboutSection } from "./typescript/AboutSection";

function App() {
  return (
    <div className="App">
      <svg  id="visual" viewBox="0 0 960 540" xmlns="http://www.w3.org/2000/svg" version="1.1">
      <path className = "bottomBlob" d="M-270 0C-257.2 -25.3 -244.4 -50.5 -236.8 -76.9C-229.2 -103.4 -226.7 -131 -215.2 -156.4C-203.7 -181.7 -183.1 -204.7 -158.7 -218.4C-134.3 -232.1 -106.2 -236.4 -79.1 -243.5C-52 -250.5 -26 -260.3 0 -270L0 0Z" fill="#418a3cff"></path></svg>


      <svg id="visual" viewBox="0 0 960 540" xmlns="http://www.w3.org/2000/svg" version="1.1">

      <path className = "topBlob" d="M270 0C265.7 28.8 261.4 57.5 249.2 81C237 104.4 216.8 122.6 202.3 146.9C187.7 171.3 178.8 202 158.7 218.4C138.6 234.9 107.4 237.2 79.1 243.5C50.8 249.7 25.4 259.9 0 270L0 0Z" fill="#6c8a3cff"></path></svg>

      <Menu/>
      <HeroSection/>
      <AboutSection/>
    </div>
  );
}

export default App;
